import React from 'react';

import style from "./Asside.module.css";

import reklama from "./image/img.png"
const Aside = () => {
    return (
        <div className={style.aside}>
            <div className={style.aside__blocks}>
                {[0,1,2,3].map(item => (
                    <div className={style.aside__block}>
                        <img className={style.aside__blockImg} src={reklama} alt="reklama"/>
                        <div className={style.aside__blockTitle}>реклама</div>
                    </div>
                    )
                )}
            </div>

        </div>
    );
};

export default Aside;
